import { useCookies } from "react-cookie";
import { useUserContext } from "../context/userContext";

const authCheck = () => {
    const {logOut} = useUserContext();
    const [cookies] = useCookies('Authorization');
    if (!cookies.get('Authorization')) {
        logOut();
    }
};

export default authCheck;
